    return (
        <nav>
            <a href="#"><IoHomeOutline /></a>
            <a href="#"><IoHomeOutline /></a>
            <a href="#"><IoHomeOutline /></a>
            <a href="#"><IoHomeOutline /></a>

        </nav>
    )
}

export default nav
